import React from "react";

function Header() {
  return (
    <div>
      <form className="form"
       style={{
        boxShadow: "0 0 2px rgb(174, 214, 241)",
        borderRadius: "10px",
        width: "80%",
        // margin: "10px",
        textAlign: "left",
        backgroundColor: "#AED6F1",
        // backgroundColor :"#EBF5FB "
        padding: "10px",
        margin: "20px auto"
      }}>
        <input
          style={{
            margin: "10px",
            boxShadow: "0 0 1px",
            border: "none",
            borderRadius: "3px"
          }}
          type="text"
          placeholder="Search"
        />
        <i class="ri-search-line" />
        <select
          style={{
            border: "none",
            width: "100px",
            margin: "20px",
            backgroundColor: "inherit"
          }}
        >
          <option>Relevance</option>
          <option>Home</option>
          <option>Explore</option>
        </select>
        <select
          style={{
            border: "none",
            width: "100px",
            margin: "20px",
            backgroundColor: "inherit"
          }}
        >
          <option>All Brands</option>
          <option>BMW</option>
          <option>Audi</option>
          <option>Jagaur</option>
        </select>
      </form>
    </div>
  );
}

export default Header;

